import React from 'react';
import "./style.css";
import Button from 'react-bootstrap/Button';

export default function Project(props) {
    return (
        <div className="project-component">
            <div className="individual-component">
                <h1>Project 1</h1>
                <Button variant="info">Info</Button>
            </div>
        </div>
    );
}
